const fs = require("fs");

function hexToBytes(hex) {
  for (var bytes = [], c = 0; c < hex.length; c += 2)
    bytes.push(parseInt(hex.substr(c, 2), 16));
  return bytes;
}

const res = hexToBytes(
  ""
);

fs.writeFileSync(
  "./csca/fr/2015/pkey.json",
  JSON.stringify({
    publicKey: res,
  })
);
